import logo from "./Assets/logo2.png"
function App() {
  return (
    <div className="flex flex-row">
  <div className="w-screen h-screen bg-white text-white">
    <img className="ml-2 mt-2 w-[469px] h-[84px]" alt="" src={logo}></img>
    </div>
    </div>

  );
}

export default App;
